import React from 'react';
import Navigation from '../components/Navigation.js';


const Home = () => {
    return (
        <div className='home'>
            <Navigation/>
            <div className='homeContent'>
                <div className='content'>
                    <h1>CARRE Cyrille</h1>
                    <h2>Développeur Front-end</h2>
                    <div className='pdf'>
                        <a href='' target="_blank">Télécharger CV</a>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Home;
